import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-identite',
  templateUrl: './identite.page.html',
  styleUrls: ['./identite.page.scss'],
})
export class IdentitePage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-buttons slot="start">
      <ion-menu-button></ion-menu-button>
    </ion-buttons>
    <ion-title>identite</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-card>
    <ion-card-header>
      <ion-card-title>OUEDRAOGO Souleymane</ion-card-title>
    </ion-card-header>
  </ion-card>
</ion-content>
